(78383174, 8570605, 0, 10, 10, 2, false, '2017-01-09T01:35:43', '2022-03-12T22:20:39', '2017-09-09T03:53:03', '1970-01-01T00:00:00', 'CFR', 'gamaleldin/CFR', 'This code package is for the Corrected-Fisher-Randomization (CFR) method. This method generates random surrogate data that preserves a specified set of first and second order marginal moments of a data tensor, which makes it well equipped to test for the null hypothesis that a structure in data is an epiphenomenon of these specified set of primary features of the data tensor. The randomization procedure used in CFR is based on Fisher randomization (shuffling). However, the shuffling is accompanied by a correction step that retains the primary features specified in the null hypothesis. Hence, the name of this method.', 'Fortran', 'UNLICENSED', ''),
(112261191, 62078680, 42, 740, 740, 27, false, '2017-11-27T23:32:17', '2022-07-15T12:08:22', '2022-06-21T15:40:46', '1970-01-01T00:00:00', 'tern', 'tern-tools/tern', 'Tern is a software composition analysis tool and Python library that generates a Software Bill of Materials for container images and Dockerfiles. The SBOM that Tern generates will give you a layer-by-layer view of what''s inside your container in a variety of formats including human-readable, JSON, HTML, SPDX and more. ', 'Python', 'BSD-2-Clause', ''),
(78486539, 8570605, 0, 15, 15, 1, false, '2017-01-10T01:44:22', '2022-04-26T10:22:40', '2017-09-09T03:33:36', '1970-01-01T00:00:00', 'TME', 'gamaleldin/TME', 'This code package is for the Tensor-Maximum-Entropy (TME) method. This method generates random surrogate data that preserves a specified set of first and second order marginal moments of a data tensor, which makes it well equipped to test for the null hypothesis that a structure in data is an epiphenomenon of these specified set of primary features of the data tensor. The random surrogate data are sampled from a maximum entropy distribution. This distribution unlike traditional maximum entropy method have constraints on the marginal first and second moments of the tensor mode.', 'Fortran', 'UNLICENSED', null),
